import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowRight, faArrowLeft } from '@fortawesome/free-solid-svg-icons'
import bg from "./assets/img/rules-bg.jpg"
import Login from './components/login';
import SignUp from './components/signup';
import Home from './components/home'
import { BrowserRouter, Routes, Route, } from "react-router-dom";
import Accueilconnexion from './AccueilConnexion';
import { auth } from '../firebase_config'
console.log("auth:",auth)

class Accueil extends Component {
    constructor(props){
        super(props);
        this.state = {
            auth : auth,
            user:auth.currentUser!=null ? auth.currentUser.displayName :""
        }
    }
    render() {
        const el = <Home user={ this.state.user }/> 
        if (auth.currentUser != null){
            el =<Accueilconnexion/>
        }
        return (
            <Routes>
                <Route path="/" element={ el } />
                <Route path="/signup" element={ <SignUp /> } />
                <Route path="/signin" element={ <Login user={ this.state.user }/> } />
                <Route path="/dashboard" element={ <Accueilconnexion/> } />
            </Routes>
        );
    }
}




export default Accueil;
